import React from 'react';
import { Route, BrowserRouter as Router, Switch, } from 'react-router-dom';
import HomePage from './components/LandingPage';

const Routes = (props) =>
    (
        <Router>
            <Switch>
                <Route exact path="/" component={HomePage} />
            </Switch>
        </Router>
    )
export default Routes;
